import React,{Component} from 'react'
import { View, 
    Text, 
    TouchableOpacity, 
    Dimensions,
    StyleSheet,
    
Image,
ImageBackground,} from 'react-native';
import Date from './Date' ;
const Menu1=(props) =>{

   


    return (
        <View>
        <View style={{flex: 1}}>
        <Image
         style={{
           alignItems:"center",
           alignContent:"center",
           
         }}
         source={require('../images/Date.png')}
         />
         <View style={{position: 'absolute',marginTop:3}}>
         <Date date="26 03"  
         />
         </View>
         <View style={{position: 'absolute',marginTop:49}}>
         <TouchableOpacity style={{position: 'absolute'}}>
         <Text style={{fontSize: 16,width:40,paddingLeft:10,marginLeft:11}}>27 03</Text>

         </TouchableOpacity>
         
         </View>
         <View style={{position: 'absolute',marginTop:100}}>
         <Date date="28 03"  
         />
         </View>
         <View style={{position: 'absolute',marginTop:159}}>
         <Date date="29 03"  
         />
         </View>
        
        

        </View>

        
        </View>

    
    );
}


;
export default Menu1;
const styles = StyleSheet.create({
    container:{
         
      marginTop:3, 
         },
       

   
  
}
);
